import React from 'react';

const Card = (props) => (
<div className="card" style={{'width': '100%', 'marginTop': '10px'}}>
   <div className="card-body">
      <h5 className="card-title">{props.info.name}</h5>
      <h6 className="card-subtitle mb-2 text-muted">by {props.info.start}</h6>
      <p className="card-text">{props.info.end}</p>
   </div>
</div>
);

export default Card;
